import React from 'react'
import { Slider, SliderProps } from '@mui/material'

const SuperRange: React.FC<SliderProps> = (props) => {
    return (
        <Slider
            sx={{
                width: '50%',  // Make the slider full width
                color: '#ffa516',  // Set the slider color
                '& .MuiSlider-thumb': {
                    backgroundColor: '#ffa516',
                    borderRadius: '50%',
                    width: 20,
                    height: 20,
                    '&:hover': {
                        backgroundColor: '#ff8c00',
                    },
                },
                '& .MuiSlider-track': {
                    backgroundColor: '#ffa516',
                },
                '& .MuiSlider-rail': {
                    backgroundColor: '#ddd',
                },
            }}
            {...props}  // Spread all props to the Slider component
        />
    )
}

export default SuperRange
